	public static int findMaxConsecutiveOnes(int[] nums) {
		int c = 0;
		int temp = 0;
		System.out.println("nums.length=" + nums.length);

		for (int i = 0; i < nums.length; i++) {
			if (nums[i] == 1) {
				temp++;
				if (i == nums.length - 1) {
					if (temp > c) {
						c = temp;
					}
				}
			} else if (nums[i] == 0) {
				if (temp > c) {
					c = temp;
				}
				temp = 0;
			}
		}
		return c;
	}

